        {
          "$schema": "http://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json",
          "contentVersion": "1.0.0.0",
          "parameters": {
            "storageAccountName": {
              "type": "string",
              "metadata": {
                "description": "Name of storage account"
              }
            },
            "availabilitySetName": {
              "type": "string",
              "metadata": {
                "description": "Name of availability set"
              }
            },
